// import logo from "./logo.svg";
import { useEffect } from "react";
import { useState } from "react";
import "./App.css";
import NavBar from "./UIComponents/navBar";
import Home from "./SitePages/homePage";
import CompSci from "./SitePages/compsciPage";
import PhotoVideo from "./SitePages/photovideoPage";
import AboutMe from "./SitePages/aboutmePage";
import ContactFooter from "./UIComponents/contactFooter";

export default function App() {
  const [currentPath, setCurrentPath] = useState(window.location.pathname);

  useEffect(() => {
    console.log(currentPath, "- Has changed");
  }, [currentPath]);

  let component;
  // console.log(`APP FUNCTION: ${window.location.pathname}`);
  switch (currentPath) {
    case "/":
      component = <Home />;
      break;
    case "/compsci":
      component = <CompSci />;
      break;
    case "/photovideo":
      component = <PhotoVideo />;
      break;
    case "/aboutme":
      component = <AboutMe />;
      break;
    default:
      component = <h1>Nope!</h1>;
  }
  return (
    <>
      <NavBar />
      {component}
      <ContactFooter />
    </>
  );
}
